                "name": "Vanilla Calendar",
                "reviewed": true,
                "sharedSettings": "null",
                "fullDescription": "## Vanilla Calendar\n\nThis plugin is perfect for applications that require a flexible and interactive calendar. It's easy to integrate and can be customized to match the look and feel of your application. The plugin also supports fetching data from an API, for displaying dynamic data.\n\n## Key Features of Vanilla Calendar\n\n**Custom Popups**: Enables you to create popups for specific dates. You can define these popups manually or fetch data from an API. The popups can have different colors (red, blue, green, orange, pink) and can display HTML content.\n\n\n**Calendar Configuration**: You can customize the type of calendar, the number of months displayed, the current date, and more. The plugin also supports different settings for ISO8601, range, visibility, and language.\n\n**Date Ranges**: Allows you to specify ranges of dates and ability to disable specific dates on the calendar.\n\n\n### Dark Vanilla Calendar\n![Dark theme calendar](https://api.directual.com/fileUploaded/my-plugin/f14f1406-a01f-48b0-8039-4082da8fec5a.png)\n\n### Light Vanilla Calendar\n![Light theme calendar](https://api.directual.com/fileUploaded/my-plugin/9c7e51c2-4c59-4749-8040-c7c0262e7067.png)",
